import { PopupWithForm } from "./PopupWithForm";

export function DeletePlacePopup(props) {
    return(
        <PopupWithForm name='edit' title='Редактировать профиль' isOpen={props.isOpen} onClose={props.onClose} onSubmit={handleSubmit}>
            <input value={name || ''} onChange={handleChangeName} className="form__input form__input_data_name" type="text" placeholder="Имя" name="name" id="name" required minLength="2" maxLength="40" />
            <span className="form__error name-error"></span>
            <input value={profession || ''} onChange={handleChangeProfession} className="form__input form__input_data_profession" type="text" placeholder="О себе"
                name="profession" id="profession" required minLength="2" maxLength="200" />
            <span className="form__error profession-error"></span>
        </PopupWithForm>
    )
}
